import styled from 'styled-components';
import Walee from "../../images/walle.png";
import PlaceHolder from "../../images/place_holder.png";

const ContainerApresentacao = styled.div`
    display: flex;
    flex-direction: row;
    width: 100vw;
    height: 100vh;
    align-items: flex-start;
`;

const WaleeImg = styled.img`
    padding: 0 150px;
    margin-left: auto;
`;

const IntroImg = styled.img`
    padding: 0 130px;
    margin-right: auto;
    margin-top: 50px;
    width: 724px;
    height: 599px;
`;

const TextoDiv = styled.div`
    padding: 0 250px;
    margin-left: auto;
    margin-top: 20px;
`;

const TextoDestacado = styled.div`
    /* Adicione estilos para o texto destacado aqui */
`;

function Apresentacao() {
    return (
        <ContainerApresentacao>
            <WaleeImg src={Walee} alt="Walee" />
            <IntroImg src={PlaceHolder} alt="Place-Holder"/>
            <TextoDiv>
                <TextoDestacado>TESTE</TextoDestacado>
            </TextoDiv>
        </ContainerApresentacao>
    );
}

export default Apresentacao;
